import React from "react";
import Title from "./styles/song/title";
import ComposerStyles from "./styles/song/songStyles";
// import Composer from "./styles/song/composer";
import Link from "next/link";
// import DeleteSong from "./DeleteSong";

const Composer = ({ composer }) => (
  <ComposerStyles>
    <Title>
      <Link href={{ pathname: "/composer", query: { id: composer.id } }}>
        <a>{composer.name}</a>
      </Link>
    </Title>
    <div className="buttonList">
      <Link href={{ pathname: "update", query: { id: composer.id } }}>
        <a>Edit Composer</a>
      </Link>
    </div>
  </ComposerStyles>
);

export default Composer;
